import React from 'react';

const Logout = () => {
  const divStyle = {
    textAlign: 'center',
    margin: '20px',
    padding: '10px',
    border: '1px solid #ccc',
    borderRadius: '4px',
    backgroundColor: '#f9f9f9',
  };

  return (
    <div style={divStyle}>
      <p>Logged Out Successfully</p>
    </div>
  );
};

export default Logout;
